import React, { Component } from 'react';
import './App.css';
import Sidebar from "./components/Sidebar";
import MainContent from "./components/MainContent";
import store from "./store";

const App = () => {
  const { contacts } = store.getState();

  return (
    <div className="App">
      <Sidebar contacts={contacts} />
      <Main />
    </div>
  );
};
export default App;
